import logo from './logo.svg';
import './App.css';
import ResponsiveNavbar from './Navbar';
import Carousel from './Slider';
import ProfileCards from './home1';
import ImageSection from './performance';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ResponsiveNavbar/>
        <Carousel/>
        <ProfileCards/>
        <br></br>
        <ImageSection/>
      </header>
    </div>
  );
}

export default App;
